package com.fisk.mdm;

import com.alibaba.fastjson.JSON;
import com.fisk.common.server.ocr.IOcrHelper;
import com.fisk.common.server.ocr.OcrServerEnum;
import com.fisk.common.server.ocr.OcrServerFactory;
import com.fisk.common.server.ocr.dto.BaseRequestDTO;
import com.fisk.common.server.ocr.dto.BaseResponseDTO;
import com.fisk.common.server.ocr.dto.OcrResult;
import com.fisk.common.server.ocr.dto.aliyun.request.AliyunOcrRequestBasisParams;
import com.fisk.common.server.ocr.dto.aliyun.request.AliyunOcrRequestParams;
import org.junit.Test;
import org.junit.runner.RunWith;
import org.springframework.beans.factory.annotation.Value;
import org.springframework.boot.test.context.SpringBootTest;
import org.springframework.test.context.junit4.SpringRunner;

/**
 * @author gy
 * @version 1.0
 * @description TODO
 * @date 2022/5/31 16:45
 */
@RunWith(SpringRunner.class)
@SpringBootTest
public class OCRTest {


    @Value("${ocr.aliyun.appCode}")
    private String appCode;

    @Value("${ocr.aliyun.url}")
    private String url;

    @Test
    public void OCR_Test() {
        IOcrHelper helper = OcrServerFactory.getOCRServer(OcrServerEnum.ALIYUN);
        AliyunOcrRequestBasisParams basisParams = new AliyunOcrRequestBasisParams(appCode, url);
        AliyunOcrRequestParams aliyunOcrRequestParams = AliyunOcrRequestParams.builder()
                .img("data:image/png;base64,")
                .build();
        BaseRequestDTO requestDTO = new BaseRequestDTO();
        requestDTO.requestParams = aliyunOcrRequestParams;
        requestDTO.basisParams = basisParams;
        OcrResult<? extends BaseResponseDTO> res = helper.invoke(requestDTO);
        System.out.println(JSON.toJSONString(res));
    }
}
